import './App.css';
import ReactMapGL from 'react-map-gl'
import { useState } from 'react';

52.51455340483158, 4.96418414313173

function App() {
  const [viewport, setViewport] = useState({
    latitude: 52.51455340483158,
    longitude: 4.96418414313173,
    width: '100vw',
    height: '100vh',
    zoom: 10
  })

  return (
    <>
      <ReactMapGL
        {...viewport}
        mapboxApiAccessToken={process.env.REACT_APP_MAPBOX_TOKEN}
      ></ReactMapGL>
    </>
  );
}

export default App;
